column41:
La construction du pôle de formation BTP VRD permettra le réaménagement de l'ensemble des pôle de formation, améliorant ainsi les conditions d'accueil prévu pour 175 stagiaires en 2017. 
Les indicateurs de résultats indiqués dans la demande d'aide et dans la demande de paiement du solde correspondent aux indicateurs mentionnés dans la fiche O.S.2.3 et non pas par rapport à l'opération;
En 2017 132 stagiaires ont été formés et 208 en 2018.
